import React,{ useState, useEffect } from 'react';
const Item = ({ name}) => (
    <li>{name}</li>
    )

const About=props=>{
    const [ users, setUsers ] = useState([]);
    useEffect(() => {
        fetch('https://localhost:9000/search-route')
        .then(res => res.json())
        .then(res => {
        setUsers(res);
        });
        }, []);
        (function add(){
            setUsers({name:'Kyawswar'})
        })();
    return(
        <div>
            <ul>
            {users.map(u => <li key={u.id}>{u.first_name}</li>)}
            </ul>
        </div>
    )
}
